import classes from "./Mainbody.module.css";
import MainBodyPosts from '../Adposts/MainBodyPosts';

export default function Mainbody(props) {
  return (
    <div className={classes.Body}>
        <MainBodyPosts user={props.user}/>
    </div> 
  )
};
